# Define Pose Detection function
@st.cache_resource
def pose_detection(image, model_selection, detection_threshold, tracking_threashold, landmark):
    with mp_pose.Pose(model_complexity=model_selection, min_detection_confidence=detection_threshold, min_tracking_confidence=tracking_threashold) as pose:
        # Convert the image to RGB format
        image = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)
        # Make the image read-only
        image.flags.writeable = False
        # Process the image to detect the pose landmarks
        results = pose.process(image)
        # Make the image writable again
        image.flags.writeable = True
        # Convert the image back to BGR format
        image = cv2.cvtColor(image, cv2.COLOR_RGB2BGR)

        # Draw the landmarks in the image based on the selected landmark type
        if results.pose_landmarks and results.pose_world_landmarks:
            if landmark == '2D':
                mp_drawing.draw_landmarks(image, results.pose_landmarks, mp_pose.POSE_CONNECTIONS)

            elif landmark == '3D':
                mp_drawing.plot_landmarks(results.pose_world_landmarks, mp_pose.POSE_CONNECTIONS)
        # Return the image with the detected pose landmarks
        return image, results.pose_landmarks
    
# Angle Heuristics
@st.cache_data
def calculate_angle(landmark1, landmark2, landmark3):
    '''
    This function calculates the angle between three different landmarks.
    Args:
        landmark1: The first landmark containing the x, y, and z coordinates.
        landmark2: The second landmark containing the x, y, and z coordinates.
        landmark3: The third landmark containing the x, y, and z coordinates.
    Returns:
        angle: The calculated angle between the three landmarks.
    '''
    x1, y1, _ = landmark1.x, landmark1.y, landmark1.z
    x2, y2, _ = landmark2.x, landmark2.y, landmark1.z
    x3, y3, _ = landmark3.x, landmark3.y, landmark1.z

    vec1 = (x1 - x2, y1 - y2)
    vec2 = (x3 - x2, y3 - y2)
    dot_product = vec1[0] * vec2[0] + vec1[1] * vec2[1]
    determinant_product = vec1[0] * vec2[1] - vec1[1] * vec2[0]
    angle = math.degrees(math.atan2(determinant_product, dot_product))

    if angle < 0:
        angle += 360
    
    return angle

# Angle Calculation
@st.cache_data
def get_angles(landmarks, display=False):

    # Get the angle between the left shoulder, elbow and wrist points. 
    left_elbow_angle = calculate_angle(landmarks.landmark[mp_pose.PoseLandmark.LEFT_SHOULDER.value],
                                       landmarks.landmark[mp_pose.PoseLandmark.LEFT_ELBOW.value],
                                       landmarks.landmark[mp_pose.PoseLandmark.LEFT_WRIST.value])
    
    # Get the angle between the right shoulder, elbow and wrist points. 
    right_elbow_angle = calculate_angle(landmarks.landmark[mp_pose.PoseLandmark.RIGHT_SHOULDER.value],
                                       landmarks.landmark[mp_pose.PoseLandmark.RIGHT_ELBOW.value],
                                       landmarks.landmark[mp_pose.PoseLandmark.RIGHT_WRIST.value])   
    
    # Get the angle between the left elbow, shoulder and hip points. 
    left_shoulder_angle = calculate_angle(landmarks.landmark[mp_pose.PoseLandmark.LEFT_ELBOW.value],
                                         landmarks.landmark[mp_pose.PoseLandmark.LEFT_SHOULDER.value],
                                         landmarks.landmark[mp_pose.PoseLandmark.LEFT_HIP.value])
 
    # Get the angle between the right hip, shoulder and elbow points. 
    right_shoulder_angle = calculate_angle(landmarks.landmark[mp_pose.PoseLandmark.RIGHT_HIP.value],
                                          landmarks.landmark[mp_pose.PoseLandmark.RIGHT_SHOULDER.value],
                                          landmarks.landmark[mp_pose.PoseLandmark.RIGHT_ELBOW.value])
 
    # Get the angle between the left hip, knee and ankle points. 
    left_knee_angle = calculate_angle(landmarks.landmark[mp_pose.PoseLandmark.LEFT_HIP.value],
                                     landmarks.landmark[mp_pose.PoseLandmark.LEFT_KNEE.value],
                                     landmarks.landmark[mp_pose.PoseLandmark.LEFT_ANKLE.value])
 
    # Get the angle between the right hip, knee and ankle points 
    right_knee_angle = calculate_angle(landmarks.landmark[mp_pose.PoseLandmark.RIGHT_HIP.value],
                                      landmarks.landmark[mp_pose.PoseLandmark.RIGHT_KNEE.value],
                                      landmarks.landmark[mp_pose.PoseLandmark.RIGHT_ANKLE.value])
    
    return left_elbow_angle, right_elbow_angle, left_shoulder_angle, right_shoulder_angle, left_knee_angle, right_knee_angle

# Pose Classification
@st.cache_data
def pose_classification(body_angles):
    '''
    This function classifies poses using the angle obtained between diffrent landmarks.
    Args:
        body_angles : A tuple containing body angles.
    Returns:
        yogasana: A boolean value if yoga pose is detected.
        asana_name: The name of the corrosponding detected asana.
        asana_image: The image of the corrosponding detected asana
    '''
    # Definie the variables
    yogasana, asana_name, asana_image = False, None, None
    # Retreiving corrosponding values of body_angles
    left_elbow_angle, right_elbow_angle, left_shoulder_angle, right_shoulder_angle, left_knee_angle, right_knee_angle = body_angles
    
    # Veerbhadhrasana
    if left_elbow_angle > 165 and left_elbow_angle < 195 and right_elbow_angle >165 and right_elbow_angle < 195:
        if left_shoulder_angle > 80 and left_shoulder_angle < 110 and right_shoulder_angle > 80 and right_shoulder_angle < 110:            
            if left_knee_angle > 165 and left_knee_angle < 195 or right_knee_angle > 165 and right_knee_angle < 195:
                #if left_knee_angle > 90 and left_knee_angle < 120 or right_knee_angle > 90 and right_knee_angle < 120:
                yogasana = True
                asana_name = "Veerbhadrasana"
                asana_image = verbhadrasana_image

    return yogasana, asana_name, asana_image

def exit_app():
    cv2.destroyAllWindows()
    st.stop()

# Define app main
def main():
    set_theme()

    #Header
    st.title('Posedion')
    st.write('This app can detect and track yoga asans')

    # Slidebar
    st.sidebar.title('Posedion')

    # Sidebar-Parameters
    parameter_expander = st.sidebar.expander('Model Parameters')
    with parameter_expander:
        model_dict = {"Heavy": 0, "Full": 1, "Lite": 2}
        model_value = model_dict[parameter_expander.selectbox("Select a pose detection model", model_dict.keys())]

        detection_confidence = parameter_expander.slider('Min Detection Confidence', min_value=0.0, max_value=1.0, value=0.5)
        tracking_confidence = parameter_expander.slider('Min Tracking Confidence', min_value=0.0, max_value=1.0, value=0.5)

        lm = parameter_expander.select_slider('Plot Landmarks', options=['2D', '3D'])

    record = st.sidebar.checkbox('Record Video', value=False)

    st.sidebar.markdown('---')

    # sidebar-YOGA
    sidebar_container = st.sidebar.container()
    sidebar_container.subheader('Asana')
    asana_img_out = sidebar_container.empty()
    asana_name_out = sidebar_container.empty()
    asana_hold_label = sidebar_container.empty()

    asana_img_out.image(sidebar_image, use_column_width=True, channels='BGR')
    asana_name_out.success('Asana')
    asana_hold_label.text('Asana Held For : ' + str(00) +' Sec')

    stop = st.sidebar.button('**EXIT**',use_container_width=True)

    # Video Input
    #st.set_option('deprecation.showfileUploaderEncoding', False)
    vid_file_buffer = st.file_uploader('Upload Video', type=['mp4','mov','avi','m4v','webm'])
    use_webcam = st.button('Use Webcam',use_container_width=True)
    tf_file = tempfile.NamedTemporaryFile(delete=False)

    # Display
    input, output = st.columns([1, 1])
    with input:
        st.caption('Input Video')
        input_vid_container = st.empty()
    with output:
        st.caption('Output Video')
        output_vid_container = st.empty()

    if not vid_file_buffer:
        if use_webcam:
            video = cv2.VideoCapture(0)
            video.set(cv2.CAP_PROP_FRAME_WIDTH, 1280)
            video.set(cv2.CAP_PROP_FRAME_HEIGHT, 720)

        else:
            st.error("use webcam or upload a file!")
            input_vid_container.empty()
            video = None
    else:
        tf_file.write(vid_file_buffer.read())
        video = cv2.VideoCapture(tf_file.name)
        input_vid_container.video(tf_file.name)

    if video:
        frame_size = (int(video.get(cv2.CAP_PROP_FRAME_WIDTH)), int(video.get(cv2.CAP_PROP_FRAME_HEIGHT)))
        fps = int(video.get(cv2.CAP_PROP_FPS))

        #Recording
        codec = cv2.VideoWriter_fourcc(*'avc1')
        out = cv2.VideoWriter('output.mp4', codec, fps, frame_size)
        
        asana_hold_time = None

        while video.isOpened():
            ret, img = video.read()
            if not ret:
                break

            #img = cv2.resize(img, None, fx=0.5, fy=0.5, interpolation=cv2.INTER_LINEAR)

            frame = np.array(img)
            input_vid_container.image(frame, channels="BGR")

            img, pose_landmarks = pose_detection(img,model_selection=model_value,detection_threshold=detection_confidence, tracking_threashold=tracking_confidence,landmark=lm)
            output_vid_container.image(img, channels="BGR")

            if pose_landmarks:
                body_angles = get_angles(pose_landmarks,True)

                success, asana_name, asana_image = pose_classification(body_angles)

                if success:
                    asana_img_out.image(asana_image, use_column_width=True, channels='BGR')
                    asana_name_out.success(asana_name)
                    asana_hold_time += 1
                    asana_hold_label.text(asana_name + ' Held For : ' + str(asana_hold_time) +' Sec')
                else:
                    asana_hold_time = 0
                    asana_img_out.image(sidebar_image, use_column_width=True, channels='BGR')
                    asana_name_out.success('Asana')
                    asana_hold_label.text('Asana Held For : ' + str(00) +' Sec')

            if record:
                out.write(img)

            if stop:
                video.release()
                out.release()
                exit_app()
        
    footer()

if __name__ == '__main__':
    main()